    const inputObj = {id: 'Amount', type: 'number', min: '1', max: '5', step: '1', defaultValue: '1'}
    const btn = {}
    return <form className={styles.form}>
        <Input label="Amount" input={inputObj}/>
        <Button options={btn}>+ Add</Button>
    </form>
}

